import React from 'react';

function GlobalCases(props) {
  return(
    <table>
      <thead>
        <th> NewConfirmed </th>
        <th> TotalConfirmed </th>
        <th> NewDeaths </th>
        <th> TotalDeaths </th>
        <th> NewRecovered </th>
        <th> TotalRecovered </th>
      </thead>
    </table>  
  );
}

export default GlobalCases;
